In the distasteful dating realm of lame pickup lines, one-night-stands-gone-bad, meaningless booty calls, maniacal nymphomaniacs, and creepy men-
grounded young singles, Sarah and Eric, search for something more. Despite their friends' protests that Internet dating is an act of desperation,
they decide to give it a shot.
But will Sarah (Kate Morgan) and Eric find that online dating is just as bad as the more traditional ways of meeting other singles? Or, will they
finally find the true love for which they've been searching?
